
import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;


public class findAnagrams {
    // Time Complexity :O(M+N) -> M,N - length of s and p  
    // Space Complexity :O(N) -> N - length of p
    // Did this code successfully run on Leetcode : Yes
    // Any problem you faced while coding this : No
    
    // Your code here along with comments explaining your approach
    // 1. Put all charcters of p into a hashmap.
    // 2. Now use sliding window approach . Have two pointers left and right . Till right-left is equal to p.length add each character 
    //    of s at right's position into a new hashmap and increment right. 
    // 3. Now if right-left is equal to p's length compare both hashmaps . If they are equal then add left to result. Now remove character at 
    //    left position and increment both left and right pointers . Do this till right is less than length of strng s. 
    
    public static List<Integer> findAnagrams2(String s,String p){
        HashMap<Character,Integer> map = new HashMap<>();
        List<Integer> result = new ArrayList<>();
        if(s.length()<p.length())   return result;
        for(char c: p.toCharArray()){
            if(!map.containsKey(c))
                map.put(c,1);
            else
                map.put(c,map.get(c)+1);
        }
        HashMap<Character,Integer> submap = new HashMap<>();
        int left = 0,right = 0;
        while(right<s.length()){
            if(!submap.containsKey(s.charAt(right)))
                submap.put(s.charAt(right),1);
            else
                submap.put(s.charAt(right),submap.get(s.charAt(right))+1);

            right++;
            if(right-left == p.length()){
                if(submap.equals(map))
                    result.add(left);
                if(submap.get(s.charAt(left))>1)
                    submap.put(s.charAt(left),submap.get(s.charAt(left))-1);
                else
                    submap.remove(s.charAt(left));
                left++;
            }
        }
        return result;
    }
    // Time Complexity :O(M*N) -> M,N - length of s and p  
    // Space Complexity :O(M*N) -> N - length of p
    // Did this code successfully run on Leetcode : No (Failed for last case)
    // Any problem you faced while coding this : No

    // Your code here along with comments explaining your approach
    // 1. Put all charcters of p into a hashmap.
    // 2. Now traverse through each character in s and check if it's present  in main hashmap.Else move on to next character.
    // 3. Now starting from this position check if it's present in hashmap and move on to next character else break from loop.Do this till length of p times.
    // 4. Now after moving p's length times and we found all our characters then we can add starting position to result. and repeat above process
    //    for all characters in s till s.length() - p.length().
    public static List<Integer> findAnagrams(String s, String p) {
        HashMap<Character,Integer> map = new HashMap<>();
        List<Integer> result = new ArrayList<>();
        if(s.length()<p.length())   return result;
        for(char c: p.toCharArray()){
            if(!map.containsKey(c))
                map.put(c,1);
            else
                map.put(c,map.get(c)+1);
        }
        for(int i = 0;i<=s.length()-p.length();i++){
            if(map.containsKey(s.charAt(i))){
                HashMap<Character,Integer> copy = new HashMap<>(map);
                int pos = i;
                while(pos < i+p.length()){
                    if(copy.get(s.charAt(pos))!=null && copy.get(s.charAt(pos))>0){
                        copy.put(s.charAt(pos),copy.get(s.charAt(pos))-1);
                        pos++;
                    }
                    else
                        break;
                }
                if(pos == i+p.length())
                    result.add(i);
            }
        }
        return result;
    }

    public static void main(String[] args) {
        String s1 = "cbaebabacd";
        String p1 = "abc";
        String s = "";
        String p = "";
        //System.out.println(s.length()+"   "+p.length());
        List<Integer> x = findAnagrams2(s1,p1);
        for(int i : x)
            System.out.print(i+"  ");
    }
}
